import {
  Badge,
  Card,
  CardHeader,
  CardFooter,
  DropdownMenu,
  DropdownItem,
  UncontrolledDropdown,
  DropdownToggle,
  Media,
  Pagination,
  PaginationItem,
  PaginationLink,
  Progress,
  Table,
  Container,
  Row,
  // UncontrolledTooltip,
} from "reactstrap";
import BootstrapTable from "react-bootstrap-table-next";
import PaginationFactory from "react-bootstrap-table2-paginator";
import { Modal, Button } from "react-bootstrap";
// core components
import { useHistory } from "react-router-dom";
import Header from "components/Headers/Header.js";
import React, { useState, useEffect } from "react";
// import { GoogleMap, InfoWindow, Marker } from "@react-google-maps/api";
import { endpoints } from "../api-endpoints";
import paginationFactory from "react-bootstrap-table2-paginator";

const Drivers = () => {
  const [modalInfo, setModalInfo] = useState([]);
  const [showModal, setShowModal] = useState(false);
  const [show, setShow] = useState(false);
  const [drivers, setDrivers] = useState([]);
  const driver = [];
  const navigate = useHistory();

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  useEffect(() => {
    async function fetchUsers() {
      const fullResponse = await fetch(endpoints.getDrivers);
      const responseJson = await fullResponse.json();
      setDrivers(responseJson.users);
    }

    fetchUsers();
  }, []);

  drivers.forEach((user) => {
    driver.push(user);
  });

  console.log(
    "Created drivers>>>>>>> from headers from map markers used",
    driver
  );

  const handleViewDriver = (drivers) => {
    window.localStorage.setItem("driver", JSON.stringify(drivers));
    // window.localStorage.setItem("driver", JSON.stringify(driver))
    navigate.push("/driver-profile");
  };

  const rowEvents = {
    onClick: (row) => {
      console.log("Row list", row);
    },
  };
  const columns = [
    { dataField: "first_name", text: "Driver Name" },
    { dataField: "email", text: "Driver Name" },
    { dataField: "number", text: "Driver Name" },
    { dataField: "vehicle_details.v_liscense", text: "Driver Name" },
    { dataField: "reg_status", text: "Driver Name" },
  ];
  return (
    <>
      <Header />
      {/* Page content */}
      <Container className="mt--7" fluid>
        {/* Table */}
        <CardHeader className="border-0">
          <h3 className="mb-0">Drivers list</h3>
        </CardHeader>
        {/* <BootstrapTable
          keyField="name"
          // className="col"
          data={driver}
          columns={columns}
          pagination={paginationFactory()}
          rowEvent={rowEvents}
        /> */}
        <Row>
          <div className="col">
            <Card className="shadow">
              <CardHeader className="border-0">
                <h3 className="mb-0">Drivers list</h3>
              </CardHeader>
              <Table className="align-items-center table-flush" responsive>
                <thead className="thead-light">
                  <tr>
                    <th scope="col">Name</th>
                    <th scope="col">Email</th>
                    <th scope="col">Phone Numebr</th>
                    <th scope="col">Vehicle</th>
                    <th scope="col">Reg. Status</th>
                    <th scope="col" />
                  </tr>
                </thead>
                <tbody>
                  {driver.map((d) => (
                    <tr key={d._id}>
                      <th scope="row">
                        <Media className="align-items-center">
                          <a
                            className="avatar rounded-circle mr-3"
                            href="#pablo"
                            onClick={(e) => e.preventDefault()}
                          >
                            <img
                              alt="..."
                              src={
                                require("../assets/img/theme/bootstrap.jpg")
                                  .default
                              }
                            />
                          </a>
                          <Media>
                            <span className="mb-0 text-sm">
                              {d.fist_name} {d.last_name}
                            </span>
                          </Media>
                        </Media>
                      </th>
                      <td>{d.email}</td>
                      <td>
                        <Badge color="" className="badge-dot mr-4">
                          <i className="bg-warning" />
                          {d.number}
                        </Badge>
                      </td>
                      <td>{d.vehicle_details.v_license}</td>
                      <td>
                        <div className="d-flex align-items-center">
                          <span className="mr-2">completed</span>
                          <div>
                            <Progress
                              max="100"
                              value="100"
                              barClassName="bg-success"
                            />
                          </div>
                        </div>
                      </td>
                      <td className="text-right">
                        <UncontrolledDropdown>
                          <DropdownToggle
                            className="btn-icon-only text-light"
                            href="#pablo"
                            role="button"
                            size="sm"
                            color=""
                            onClick={(e) => e.preventDefault()}
                          >
                            <i className="fas fa-ellipsis-v" />
                          </DropdownToggle>
                          <DropdownMenu className="dropdown-menu-arrow" right>
                            <DropdownItem
                              href="#"
                              // rowEvent={rowEvents}
                              rowEvents={rowEvents}
